import React from 'react';
import { element } from 'prop-types';
import { Box } from '@material-ui/core'
import Header from '../header'

const Layout = ({ children }) => (
  <Box id="new">
      {/* <Header /> */}
      {children}
  </Box>
);

Layout.defaultProps = {};

Layout.propTypes = {
  children: element,
};

export default Layout;
